import React from "react";
import Slider from "react-slick";

const RaportowanieCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
  };

  return <Slider {...settings}>{/* Twoje slajdy */}</Slider>;
};

export default RaportowanieCarousel;
